import { Link } from "react-router-dom";

function ProductPage() {
  return (
    <>
      <h1>Products</h1>
      <ul>
        <li>
          <Link to="/products/product-1">Product1</Link>
        </li>
        <li>
          <Link to="/products/product-2">Product2</Link>
        </li>
        <li>
          <Link to="/products/product-3">Product3</Link>
        </li>
      </ul>
    </>
  );
}

export default ProductPage;
